import "bootstrap/dist/css/bootstrap.min.css";
import "font-awesome/css/font-awesome.min.css";
import React, { useState } from "react";
import axios from "axios";

const LoginPage = ({setIsLoggedIn}) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [errorMsg, setErrorMsg] = useState("");

  const handleLogin = async (e) => {
    e.preventDefault();
    setErrorMsg("");

    try {
      const response = await axios.post("http://localhost:3001/auth/login", {
        email,
        password,
      });

      localStorage.setItem("token", response.data.token);
      setIsLoggedIn(true);
      alert("Login Success");
    } catch (error) {
      if (error.response) {
        setErrorMsg(error.response.data.message);
      } else {
        setErrorMsg("Something went wrong!");
      }
    }
  };


  return (
    <div className="wraper">
      <div className="container">
        <div className="row">
          <div className="col-12 col-sm-8 col-md-6 col-lg-4 mx-auto mt-5">
            <section id="login-body" className="pt-3">
              <div className="card border-0 shadow pt-3">
                <div className="card-header bg-transparent border-bottom-0 pb-0 text-center">
                  <img
                    src="/assets/img/logo-indoexpress.png"
                    alt="Logo Indoexpress"
                    className="img-fluid mx-auto d-block"
                  />
                  <div className="mt-3">
                    <span className="card-info text-center">
                      Masuk untuk melakukan absensi
                    </span>
                  </div>
                </div>
                <div className="card-body">
                  {errorMsg && (
                    <div className="alert alert-danger text-center">
                      {errorMsg}
                    </div>
                  )}
                  <form onSubmit={handleLogin}>
                    <div className="form-group">
                      <label htmlFor="username">Username :</label>
                      <div className="input-group">
                        <div className="input-group-prepend">
                          <span className="input-group-text">
                            <i className="fa fa-user"></i>
                          </span>
                        </div>
                        <input
                          type="text"
                          name="username"
                          id="username"
                          className="form-control"
                          autoComplete="username"
                          value={email}
                          placeholder="Masukan Username anda"
                          onChange={(e) => setEmail(e.target.value)}
                        />
                      </div>
                    </div>

                    <div className="form-group">
                      <label htmlFor="password">Password :</label>
                      <div className="input-group">
                        <div className="input-group-prepend">
                          <span className="input-group-text">
                            <i className="fa fa-lock"></i>
                          </span>
                        </div>
                        <input
                          type="password"
                          name="password"
                          id="password"
                          className="form-control"
                          value={password}
                          autoComplete="current-password"
                          placeholder="**********"
                          onChange={(e) => setPassword(e.target.value)}
                        />
                      </div>
                    </div>

                    <div className="form-group mt-4">
                      <button
                        type="submit"
                        className="btn btn-primary btn-block"
                      >
                        Login
                      </button>
                    </div>
                  </form>
                </div>
              </div>
            </section>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
